import React from 'react'
import '../App.css'
import {Link} from 'react-router-dom'
import { Box, Button, Stack, Typography } from '@mui/material'
import '../App.css'
import linkedin from '../assets/images/linkedin.png'
import github from '../assets/images/github.png'
import insta from '../assets/images/instagram.png'
import twitter from '../assets/images/twitter.png'
import facebook from '../assets/images/facebook.png'


const HomePage = () => {
  return (
    <Box sx={{mt: {lg: '212px', xs: '70px'}, ml:{ sm:'50px'}}} position="relative" >
        <Typography color="" fontWeight="700" sx={{fontSize: {lg: '44px', xs: '40px'}}} mb="23px" mt="30px">Sleep, Code <br />and Repeat</Typography>
        <Typography fontSize="22px" lineHeight="35px" mb={4}>Check out My projects</Typography>
        <Link to = "/projects" style={{textDecoration: "none"}}>

        <Button variant = "contained" color="error"  sx={{backgroundColor: '	#008F11', padding: '10px'}}>Explore Projects</Button>

        </Link>
        <Typography fontWeight={600} color="#008F11" sx={{
            opacity: 0.5,
            display: {lg: 'block', xs: 'none'}
        }} 
        fontSize="200px">Developer</Typography>
        
        
        </Box>
  )
}

export default HomePage;
